import React, {Component} from 'react';

import '../Misc/css/MoviesSearch.css'

class MovieSearch extends Component {
	constructor(props) {
		super(props)

		const movies = [
			{id:0, title:"Avengers: Infinity War", overview: "summary"},
			{id:1, title:"Avengers", overview: "summary"}
		]

		this.state = {row: [
			<p key="1">this is my row0</p>,
			<p key="2">this is my row1</p>,
			<p key="3">this is my row2</p>
		]}

		var moviesRows = [];
		movies.forEach((movies) => {
			console.log(movie.id)
			moviesRows.push(<p key={movie.id}>movie title: {movie.title}</p>)
		})

		this.state = {rows: moviesRows};
	}
render() {
return(
	<div class="search-container">
  		<div class="row">
    		<div class="col-sm">
      			<input className="search-bar" placeholder="Please enter movie name"/>
    		</div>
  		</div>
	</div>
	)
	}
}

export default MovieSearch;
